$('.delete-confirm').on('click', function (event) {
  event.preventDefault();
  var url = $(this).attr('href');
  var id = $(this).attr('data-id');
  swal({
    title: 'Are you sure?',
    text: 'Would you like to proceed with your current action!',
    icon: 'warning',
    buttons: ["Cancel", "Yes!"]
  }).then(function (value) {
    if (value) {
      $('#deletecat' + id).submit();
    }
  });
}); // block user

